// iff cond == 1  val <- -val
func p256NegCond(val []uint64, cond int)

// if cond == 0 res <- b; else res <- a
func p256MovCond(res, a, b []uint64, cond int)

// Endianess swap
func p256BigToLittle(res []uint64, in []byte)
func p256LittleToBig(res []byte, in []uint64)

