func (curve p256Curve) Inverse(k *big.Int) *big.Int {
	var table [4 * 15]uint64
	x := make([]uint64, 4, 4)
	t := make([]uint64, 4, 4)
	xout := make([]byte, 32, 32)
	RR := []uint64{0x83244c95be79eea2, 0x4699799c49bd6fa6, 0x2845b2392b6bec59, 0x66e12d94f3d95620}
	one := []uint64{1, 0, 0, 0}

	expLo := [32]byte{0xb, 0xc, 0xe, 0x6, 0xf, 0xa, 0xa, 0xd, 0xa, 0x7, 0x1, 0x7, 0x9, 0xe, 0x8, 0x4, 0xf, 0x3, 0xb, 0x9, 0xc, 0xa, 0xc, 0x2, 0xf, 0xc, 0x6, 0x3, 0x2, 0x5, 0x4, 0xf}

	fromBig(x, k)
	p256OrdMul(table[4*0:4*0+4], x, RR) // To Montgomery
	// Prepare the table, no need in constant time access, because the power is not a secret, entry 0 is never used as well
	for i := 2; i < 16; i += 2 {
		p256OrdSqr(table[4*(i-1):4*i+4], table[4*((i/2)-1):4*((i/2)-1)+4], 1)
		p256OrdMul(table[4*i:4*i+4], table[4*(i-1):4*(i-1)+4], table[4*0:4*0+4])
	}

	x[0] = table[4*14+0] // f
	x[1] = table[4*14+1]
	x[2] = table[4*14+2]
	x[3] = table[4*14+3]

	p256OrdSqr(x, x, 4)
	p256OrdMul(x, x, table[4*14:4*14+4]) // ff
	t[0] = x[0]
	t[1] = x[1]
	t[2] = x[2]
	t[3] = x[3]

	p256OrdSqr(x, x, 8)
	p256OrdMul(x, x, t) // ffff
	t[0] = x[0]
	t[1] = x[1]
	t[2] = x[2]
	t[3] = x[3]

	p256OrdSqr(x, x, 16)
	p256OrdMul(x, x, t) // ffffffff
	t[0] = x[0]
	t[1] = x[1]
	t[2] = x[2]
	t[3] = x[3]

	p256OrdSqr(x, x, 64) // ffffffff0000000000000000
	p256OrdMul(x, x, t)  // ffffffff00000000ffffffff
	p256OrdSqr(x, x, 32) // ffffffff00000000ffffffff00000000
	p256OrdMul(x, x, t)  // ffffffff00000000ffffffffffffffff

	// Remaining 32 windows
	for i := 0; i < 32; i++ {
		p256OrdSqr(x, x, 4)
		p256OrdMul(x, x, table[4*(expLo[i]-1):])
	}

	p256OrdMul(x, x, one)
	p256LittleToBig(xout, x)
	r := new(big.Int).SetBytes(xout)
	return r
}

func fromBig(out []uint64, big *big.Int) {
	Bits := big.Bits()
	if len(Bits) > 0 {
		out[0] = uint64(Bits[0])
	}
	if len(Bits) > 1 {
		out[1] = uint64(Bits[1])
	}
	if len(Bits) > 2 {
		out[2] = uint64(Bits[2])
	}
	if len(Bits) > 3 {
		out[3] = uint64(Bits[3])
	}
}

// p256GetScalar endian-swaps the big-endian scalar value from in and writes it
// to out. If the scalar is equal or greater than the order of the group, it's
// reduced modulo that order.
func p256GetScalar(out []uint64, in []byte) {
	n := new(big.Int).SetBytes(in)

	if n.Cmp(p256.N) >= 0 {
		n.Mod(n, p256.N)
	}
	fromBig(out, n)
}

func (curve p256Curve) CombinedMult(bigX, bigY *big.Int, baseScalar, scalar []byte) (x, y *big.Int) {
	var scalarReversed []uint64 = make([]uint64, 4, 4)
	var r1, r2 p256Point
	rr := []uint64{0x0000000000000003, 0xfffffffbffffffff, 0xfffffffffffffffe, 0x00000004fffffffd}

	p256GetScalar(scalarReversed, baseScalar)
	p256BaseMult(&r1, scalarReversed)

	p256GetScalar(scalarReversed, scalar)
	fromBig(r2.xyz[0:4], bigX)
	fromBig(r2.xyz[4:8], bigY)
	p256Mul(r2.xyz[0:4], r2.xyz[0:4], rr)
	p256Mul(r2.xyz[4:8], r2.xyz[4:8], rr)
	r2.xyz[8] = 0x0000000000000001
	r2.xyz[9] = 0xffffffff00000000
	r2.xyz[10] = 0xffffffffffffffff
	r2.xyz[11] = 0x00000000fffffffe

	p256ScalarMult(&r2, &r2, scalarReversed)
	p256PointAddAsm(r1.xyz[:], r1.xyz[:], r2.xyz[:])
	return p256PointToAffine(&r1)
}

func (curve p256Curve) ScalarBaseMult(scalar []byte) (x, y *big.Int) {
	var scalarReversed []uint64 = make([]uint64, 4, 4)
	var r p256Point

	p256GetScalar(scalarReversed, scalar)
	p256BaseMult(&r, scalarReversed)
	return p256PointToAffine(&r)
}

func (curve p256Curve) ScalarMult(bigX, bigY *big.Int, scalar []byte) (x, y *big.Int) {
	var scalarReversed []uint64 = make([]uint64, 4, 4)
	var r p256Point
	rr := []uint64{0x0000000000000003, 0xfffffffbffffffff, 0xfffffffffffffffe, 0x00000004fffffffd}

	p256GetScalar(scalarReversed, scalar)
	fromBig(r.xyz[0:4], bigX)
	fromBig(r.xyz[4:8], bigY)
	p256Mul(r.xyz[0:4], r.xyz[0:4], rr)
	p256Mul(r.xyz[4:8], r.xyz[4:8], rr)
	r.xyz[8] = 0x0000000000000001
	r.xyz[9] = 0xffffffff00000000
	r.xyz[10] = 0xffffffffffffffff
	r.xyz[11] = 0x00000000fffffffe

	p256ScalarMult(&r, &r, scalarReversed)
	return p256PointToAffine(&r)
}

func p256PointToAffine(in *p256Point) (xxOut, yyOut *big.Int) {
	var zInv, zInvSq []uint64 = make([]uint64, 4, 4), make([]uint64, 4, 4)
	var xOut, yOut []byte = make([]byte, 32, 32), make([]byte, 32, 32)

	x, y := new(big.Int), new(big.Int)
	p256Inverse(zInv, in.xyz[8:12])
	p256Sqr(zInvSq, zInv)
	p256Mul(zInv, zInv, zInvSq)

	p256Mul(zInvSq, in.xyz[0:4], zInvSq)
	p256Mul(zInv, in.xyz[4:8], zInv)

	p256FromMont(zInvSq, zInvSq)
	p256FromMont(zInv, zInv)

	p256LittleToBig(xOut, zInvSq)
	p256LittleToBig(yOut, zInv)
	x.SetBytes(xOut)
	y.SetBytes(yOut)

	return x, y
}

func p256Inverse(res, in []uint64) {
	var stack [6 * 4]uint64
	p2 := stack[4*0 : 4*0+4]
	p4 := stack[4*1 : 4*1+4]
	p8 := stack[4*2 : 4*2+4]
	p16 := stack[4*3 : 4*3+4]
	p32 := stack[4*4 : 4*4+4]

	p256Sqr(res, in)
	p256Mul(p2, res, in) // 3*p

	p256Sqr(res, p2)
	p256Sqr(res, res)
	p256Mul(p4, res, p2) // f*p

	p256Sqr(res, p4)
	p256Sqr(res, res)
	p256Sqr(res, res)
	p256Sqr(res, res)
	p256Mul(p8, res, p4) // ff*p

	p256Sqr(res, p8)

	for i := 0; i < 7; i++ {
		p256Sqr(res, res)
	}
	p256Mul(p16, res, p8) // ffff*p

	p256Sqr(res, p16)
	for i := 0; i < 15; i++ {
		p256Sqr(res, res)
	}
	p256Mul(p32, res, p16) // ffffffff*p

	p256Sqr(res, p32)

	for i := 0; i < 31; i++ {
		p256Sqr(res, res)
	}
	p256Mul(res, res, in)

	for i := 0; i < 32*4; i++ {
		p256Sqr(res, res)
	}
	p256Mul(res, res, p32)

	for i := 0; i < 32; i++ {
		p256Sqr(res, res)
	}
	p256Mul(res, res, p32)

	for i := 0; i < 16; i++ {
		p256Sqr(res, res)
	}
	p256Mul(res, res, p16)

	for i := 0; i < 8; i++ {
		p256Sqr(res, res)
	}
	p256Mul(res, res, p8)

	p256Sqr(res, res)
	p256Sqr(res, res)
	p256Sqr(res, res)
	p256Sqr(res, res)
	p256Mul(res, res, p4)

	p256Sqr(res, res)
	p256Sqr(res, res)
	p256Mul(res, res, p2)

	p256Sqr(res, res)
	p256Sqr(res, res)
	p256Mul(res, res, in)
}

func p256StorePoint(r *[16 * 4 * 3]uint64, p *p256Point, idx int) {
	for i := 0; i < 12; i++ {
		r[idx*12+i] = p.xyz[i]
	}
}

func boothW5(in uint) (int, int) {
	var s uint = ^((in >> 5) - 1)
	var d uint = (1 << 6) - in - 1
	d = (d & s) | (in & (^s))
	d = (d >> 1) + (d & 1)
	return int(d), int(s & 1)
}

func boothW7(in uint) (int, int) {
	var s uint = ^((in >> 7) - 1)
	var d uint = (1 << 8) - in - 1
	d = (d & s) | (in & (^s))
	d = (d >> 1) + (d & 1)
	return int(d), int(s & 1)
}

func p256BaseMult(r *p256Point, scalar []uint64) {
	var sel, sign, zero int
	var t0 p256Point

	wvalue := (scalar[0] << 1) & 0xff
	sel, sign = boothW7(uint(wvalue))
	p256SelectBase(r.xyz[0:8], p256Precomputed[0][0:], sel)
	p256NegCond(r.xyz[4:8], sign)

	r.xyz[8] = 0x0000000000000001
	r.xyz[9] = 0xffffffff00000000
	r.xyz[10] = 0xffffffffffffffff
	r.xyz[11] = 0x00000000fffffffe

	t0.xyz[8] = 0x0000000000000001
	t0.xyz[9] = 0xffffffff00000000
	t0.xyz[10] = 0xffffffffffffffff
	t0.xyz[11] = 0x00000000fffffffe

	var idx uint = 6
	zero |= sel

	for i := 1; i < 37; i++ {
		if idx < 192 {
			wvalue = ((scalar[idx/64] >> (idx % 64)) + (scalar[idx/64+1] << (64 - (idx % 64)))) & 0xff
		} else {
			wvalue = (scalar[idx/64] >> (idx % 64)) & 0xff
		}
		idx += 7
		sel, sign = boothW7(uint(wvalue))
		p256SelectBase(t0.xyz[0:8], p256Precomputed[i][0:], sel)
		p256PointAddAffineAsm(r.xyz[0:12], r.xyz[0:12], t0.xyz[0:8], sign, sel, zero)
		zero |= sel
	}
}

func p256ScalarMult(r, p *p256Point, scalar []uint64) {
	var precomp [16 * 4 * 3]uint64 // Precomputed table from p to p^16
	var t0, t1, t2, t3 p256Point

	// Prepare the table
	p256StorePoint(&precomp, p, 0) // 1

	p256PointDoubleAsm(t0.xyz[:], p.xyz[:])
	p256PointDoubleAsm(t1.xyz[:], t0.xyz[:])
	p256PointDoubleAsm(t2.xyz[:], t1.xyz[:])
	p256PointDoubleAsm(t3.xyz[:], t2.xyz[:])
	p256StorePoint(&precomp, &t0, 1)  // 2
	p256StorePoint(&precomp, &t1, 3)  // 4
	p256StorePoint(&precomp, &t2, 7)  // 8
	p256StorePoint(&precomp, &t3, 15) // 16

	p256PointAddAsm(t0.xyz[:], t0.xyz[:], p.xyz[:])
	p256PointAddAsm(t1.xyz[:], t1.xyz[:], p.xyz[:])
	p256PointAddAsm(t2.xyz[:], t2.xyz[:], p.xyz[:])
	p256StorePoint(&precomp, &t0, 2) // 3
	p256StorePoint(&precomp, &t1, 4) // 5
	p256StorePoint(&precomp, &t2, 8) // 9

	p256PointDoubleAsm(t0.xyz[:], t0.xyz[:])
	p256PointDoubleAsm(t1.xyz[:], t1.xyz[:])
	p256StorePoint(&precomp, &t0, 5) // 6
	p256StorePoint(&precomp, &t1, 9) // 10

	p256PointAddAsm(t2.xyz[:], t0.xyz[:], p.xyz[:])
	p256PointAddAsm(t1.xyz[:], t1.xyz[:], p.xyz[:])
	p256StorePoint(&precomp, &t2, 6)  // 7
	p256StorePoint(&precomp, &t1, 10) // 11

	p256PointDoubleAsm(t0.xyz[:], t0.xyz[:])
	p256PointDoubleAsm(t2.xyz[:], t2.xyz[:])
	p256StorePoint(&precomp, &t0, 11) // 12
	p256StorePoint(&precomp, &t2, 13) // 14

	p256PointAddAsm(t0.xyz[:], t0.xyz[:], p.xyz[:])
	p256PointAddAsm(t2.xyz[:], t2.xyz[:], p.xyz[:])
	p256StorePoint(&precomp, &t0, 12) // 13
	p256StorePoint(&precomp, &t2, 14) // 15

	// Start scanning the window from top bit
	var idx uint = 254
	var sel, sign, zero int = 0, 0, 0

	wvalue := (scalar[idx/64] >> (idx % 64)) & 0x3f
	sel, _ = boothW5(uint(wvalue))

	p256Select(r.xyz[0:12], precomp[0:], sel)
	zero |= sel

	for idx > 4 {
		idx -= 5
		p256PointDoubleAsm(r.xyz[:], r.xyz[:])
		p256PointDoubleAsm(r.xyz[:], r.xyz[:])
		p256PointDoubleAsm(r.xyz[:], r.xyz[:])
		p256PointDoubleAsm(r.xyz[:], r.xyz[:])
		p256PointDoubleAsm(r.xyz[:], r.xyz[:])

		if idx < 192 {
			wvalue = ((scalar[idx/64] >> (idx % 64)) + (scalar[idx/64+1] << (64 - (idx % 64)))) & 0x3f
		} else {
			wvalue = (scalar[idx/64] >> (idx % 64)) & 0x3f
		}

		sel, sign = boothW5(uint(wvalue))

		p256Select(t0.xyz[0:], precomp[0:], sel)
		p256NegCond(t0.xyz[4:8], sign)
		p256PointAddAsm(t1.xyz[:], r.xyz[:], t0.xyz[:])
		p256MovCond(t1.xyz[0:12], t1.xyz[0:12], r.xyz[0:12], sel)
		p256MovCond(r.xyz[0:12], t1.xyz[0:12], t0.xyz[0:12], zero)
		zero |= sel
	}

	p256PointDoubleAsm(r.xyz[:], r.xyz[:])
	p256PointDoubleAsm(r.xyz[:], r.xyz[:])
	p256PointDoubleAsm(r.xyz[:], r.xyz[:])
	p256PointDoubleAsm(r.xyz[:], r.xyz[:])
	p256PointDoubleAsm(r.xyz[:], r.xyz[:])

	wvalue = (scalar[0] << 1) & 0x3f
	sel, sign = boothW5(uint(wvalue))

	p256Select(t0.xyz[0:], precomp[0:], sel)
	p256NegCond(t0.xyz[4:8], sign)
	p256PointAddAsm(t1.xyz[:], r.xyz[:], t0.xyz[:])
	p256MovCond(t1.xyz[0:12], t1.xyz[0:12], r.xyz[0:12], sel)
	p256MovCond(r.xyz[0:12], t1.xyz[0:12], t0.xyz[0:12], zero)
}

